import{_ as e,o as r,c as a,Q as t}from"./chunks/framework.01af844e.js";const b=JSON.parse('{"title":"收藏资源","description":"","frontmatter":{"title":"收藏资源","date":"2023-11-17T00:00:00.000Z"},"headers":[],"relativePath":"resource/stars.md","filePath":"resource/stars.md","lastUpdated":1701151825000}'),l={name:"resource/stars.md"},i=t('<h1 id="收藏资源" tabindex="-1">收藏资源 <a class="header-anchor" href="#收藏资源" aria-label="Permalink to &quot;收藏资源&quot;">​</a></h1><h2 id="技术博客" tabindex="-1">技术博客 <a class="header-anchor" href="#技术博客" aria-label="Permalink to &quot;技术博客&quot;">​</a></h2><ul><li><a href="http://www.ruanyifeng.com/blog/archives.html" target="_blank" rel="noreferrer">阮一峰的网络日志</a>: 大神阮一峰，博客风格真正做到深入浅出。</li><li><a href="https://tech.meituan.com/" target="_blank" rel="noreferrer">美团技术团队</a>：美团技术团队的博客，干货满满。</li><li><a href="https://pdai.tech/" target="_blank" rel="noreferrer">Java 全栈知识体系</a>：最强最全的 Java 后端知识体系，包含 Java 开发体系中的各种技术。</li><li><a href="https://bugstack.cn/" target="_blank" rel="noreferrer">bugstack 虫洞栈</a>: 小傅哥的网站，主要讲解 Java 开发体系知识。</li><li><a href="https://tobebetterjavaer.com" target="_blank" rel="noreferrer">Java 程序员进阶之路</a>：一个通俗易懂、风趣幽默的 Java 学习指南。</li><li><a href="https://www.iocoder.cn/" target="_blank" rel="noreferrer">芋道源码</a>：以讲解源码为主的网站，博主是美团员工。</li><li><a href="https://blog.didispace.com/spring-boot-learning-2x/" target="_blank" rel="noreferrer">程序猿 DD</a>：主要包含 Spring 全家桶相关内容，站主是 <a href="http://spring4all.com/" target="_blank" rel="noreferrer">SpringForAll 社区</a> 成员。</li><li><a href="http://www.ityouknow.com/" target="_blank" rel="noreferrer">纯洁的微笑</a>：推荐 SpringBoot 入门系列教程。</li><li><a href="https://www.javaboy.org/springboot/" target="_blank" rel="noreferrer">江南一点雨</a>: 推荐 SpringBoot 入门系列教程。</li><li><a href="https://www.liaoxuefeng.com/" target="_blank" rel="noreferrer">廖雪峰的官方网站</a>：通过简单上手为主来达成教学目的的技术网站。</li><li><a href="https://bytesfly.github.io/blog/#/README" target="_blank" rel="noreferrer">字节飞扬</a>：签名很有个性：“互联网是有记忆的，我想留下一些成长的脚印。”</li><li><a href="https://mrhope.site/" target="_blank" rel="noreferrer">Mrhope</a>：Vuepress 主题 <em>VuePress Theme Hope</em> 的开发者。</li></ul><h2 id="学习站点" tabindex="-1">学习站点 <a class="header-anchor" href="#学习站点" aria-label="Permalink to &quot;学习站点&quot;">​</a></h2><ul><li><a href="https://itbaima.net/#/document" target="_blank" rel="noreferrer">柏码程序员</a>: 专注于计算机系列视频课程讲解【4k 视频】，为广大编程爱好者提供良好的学习环境，所有基础学习资源全部免费开放。</li><li><a href="https://www.kuangstudy.com/" target="_blank" rel="noreferrer">狂神说</a>: 为每个想学习编程的人提供一个少走弯路的平台。</li><li><a href="https://github.com/royeo/awesome-programming-books" target="_blank" rel="noreferrer">编程书籍</a>: 📚 经典技术书籍推荐，持续更新...</li></ul><h2 id="spring-全家桶" tabindex="-1">Spring 全家桶 <a class="header-anchor" href="#spring-全家桶" aria-label="Permalink to &quot;Spring 全家桶&quot;">​</a></h2><ul><li><a href="https://spring.io/" target="_blank" rel="noreferrer">Spring</a>：Spring 框架是一个流行的、开源的 Java 应用开发框架，它提供了一系列的工具和库，用于简化企业级 Java 应用程序的开发。</li><li><a href="https://docs.spring.io/spring-boot/docs/current/reference/html/" target="_blank" rel="noreferrer">SpringBoot</a>：Spring Boot 是一个用于简化 Spring 应用程序开发的框架。它基于 Spring 框架，提供了自动配置和约定优于配置的原则，使得构建独立、可扩展的 Spring 应用变得更加容易。</li><li><a href="https://docs.spring.io/spring-security/reference/index.html" target="_blank" rel="noreferrer">Spring Security</a>：</li><li><a href="https://docs.spring.io/spring-cloud-gateway/docs/current/reference/html/" target="_blank" rel="noreferrer">Spring Cloud Gateway</a>：Spring Cloud Gateway 是 Spring Cloud 的一个全新的 API 网关项目，旨在提供一种简单而有效的方法来路由到 API，并为它们提供跨领域关注点。</li><li><a href="http://www.jcohy.com/projects/spring-boot#learn" target="_blank" rel="noreferrer">Jcohy</a>：一个 Spring 官方文档的翻译站点。</li></ul><h2 id="数据库" tabindex="-1">数据库 <a class="header-anchor" href="#数据库" aria-label="Permalink to &quot;数据库&quot;">​</a></h2><ul><li><a href="https://dev.mysql.com/doc/refman/8.0/en/" target="_blank" rel="noreferrer">MySQL 8.0 Reference Manual</a>：Mysql 是应用最广泛的开源关系型数据库之一。</li><li><a href="https://blog.mybatis.org/p/products.html" target="_blank" rel="noreferrer">Mybatis</a>：MyBatis 是一款优秀的持久层框架，它支持自定义 SQL、存储过程以及高级映射。</li><li><a href="https://github.com/alibaba/druid" target="_blank" rel="noreferrer">Druid</a>：阿里巴巴数据库事业部出品，为监控而生的数据库连接池。</li><li><a href="https://redis.io/docs/" target="_blank" rel="noreferrer">Redis</a>：数百万开发人员用作数据库、缓存、流式处理引擎和消息代理的开源内存数据库。</li><li><a href="https://github.com/redisson/redisson" target="_blank" rel="noreferrer">Redisson</a>：Redis 基础上的一个 Java 驻内存数据网格（In-Memory Data Grid）,支持超过 30 个对象和服务，并且提供了多种分布式锁的实现。</li><li><a href="https://docs.influxdata.com/influxdb/v2.6/" target="_blank" rel="noreferrer">InfluxDB</a>：InfluxDB 是一个用于存储和分析时间序列数据的开源时序数据库。</li><li><a href="https://github.com/elastic/elasticsearch" target="_blank" rel="noreferrer">Elasticsearch</a>：开源，分布式，RESTful 搜索引擎。</li></ul><h2 id="编程内功" tabindex="-1">编程内功 <a class="header-anchor" href="#编程内功" aria-label="Permalink to &quot;编程内功&quot;">​</a></h2><h3 id="计算机基础" tabindex="-1">计算机基础 <a class="header-anchor" href="#计算机基础" aria-label="Permalink to &quot;计算机基础&quot;">​</a></h3><ul><li><a href="https://labuladong.github.io/algo/" target="_blank" rel="noreferrer">LABULADONG 的算法网站</a>：系统化学习算法的教程网站，内容很优质，非常推荐。</li><li><a href="https://www.hello-algo.com/" target="_blank" rel="noreferrer">Hello 算法</a>：动画图解、一键运行的数据结构与算法教程，支持 Java, C++, Python, Go, JS, TS, C#, Swift, Rust, Dart, Zig 等语言。</li><li><a href="https://www.programmercarl.com/" target="_blank" rel="noreferrer">代码随想录</a>：代码随想录是一套完整的刷题计划，旨在帮助大家少走弯路，循序渐进学算法。</li><li><a href="https://zhuanlan.zhihu.com/p/554518834" target="_blank" rel="noreferrer">图搜索：BFS 和 DFS 算法应用（万字长文）</a></li><li><a href="https://www.cs.usfca.edu/~galles/visualization/Algorithms.html" target="_blank" rel="noreferrer">算法可视化</a></li><li><a href="https://java-design-patterns.com/zh/" target="_blank" rel="noreferrer">设计模式</a></li></ul><h3 id="编程规范" tabindex="-1">编程规范 <a class="header-anchor" href="#编程规范" aria-label="Permalink to &quot;编程规范&quot;">​</a></h3><ul><li><a href="https://mp.weixin.qq.com/s/loaaKlE44P4VxMgLY3f2hw" target="_blank" rel="noreferrer">程序员“起名”头痛根治指南</a></li><li><a href="https://www.ruanyifeng.com/blog/2016/01/commit_message_change_log.html?tdsourcetag=s_pctim_aiomsg" target="_blank" rel="noreferrer">Commit message 和 Change log 编写指南</a></li><li><a href="https://www.jianshu.com/p/994797a84c5c" target="_blank" rel="noreferrer">Java 后端微服务研发规范</a></li><li><a href="https://www.imooc.com/article/293314" target="_blank" rel="noreferrer">领域模型转换那些事儿</a></li></ul><h3 id="架构设计" tabindex="-1">架构设计 <a class="header-anchor" href="#架构设计" aria-label="Permalink to &quot;架构设计&quot;">​</a></h3><ul><li><a href="https://www.cnblogs.com/xiang--liu/p/10504808.html" target="_blank" rel="noreferrer">如何画好架构图？</a></li><li><a href="https://www.infoq.cn/article/QQYdqK3yjzxrb8TbvgVC" target="_blank" rel="noreferrer">JSONQL 低代码数据模型引擎的设计与实现</a></li><li><a href="https://cloud.tencent.com/developer/article/1477870" target="_blank" rel="noreferrer">GraphQL-BFF：微服务背景下的前后端数据交互方案</a></li></ul><h2 id="微服务" tabindex="-1">微服务 <a class="header-anchor" href="#微服务" aria-label="Permalink to &quot;微服务&quot;">​</a></h2><h3 id="微服务组件" tabindex="-1">微服务组件 <a class="header-anchor" href="#微服务组件" aria-label="Permalink to &quot;微服务组件&quot;">​</a></h3><ul><li><a href="https://nacos.io/zh-cn/docs/quick-start-spring-cloud.html" target="_blank" rel="noreferrer">Nacos</a>：Nacos 是 Dynamic Naming and Configuration Service 的首字母简称，一个更易于构建云原生应用的动态服务发现、配置管理和服务管理平台。</li><li><a href="https://github.com/xuxueli/xxl-job" target="_blank" rel="noreferrer">Xxl-job</a>: Xxl-job 是一个优秀的分布式任务调度平台。</li><li><a href="https://docs.spring.io/spring-cloud-openfeign/docs/current/reference/html/" target="_blank" rel="noreferrer">Spring Cloud OpenFeign</a>：OpenFeign 是一种声明式、模板化的 HTTP 客户端。</li><li><a href="https://seata.io/zh-cn/index.html" target="_blank" rel="noreferrer">Seata</a>：Seata 是一款开源的分布式事务解决方案。</li><li><a href="https://sentinelguard.io/zh-cn/" target="_blank" rel="noreferrer">Sentinel</a>：面向分布式、多语言异构化服务架构的流量治理组件。</li><li><a href="https://kafka.apache.org/" target="_blank" rel="noreferrer">Kafka</a>：Apache Kafka 是一个开源分布式事件流平台，被数千家公司用于高性能数据管道、流分析、数据集成和任务关键型应用程序。</li><li><a href="https://www.rabbitmq.com/" target="_blank" rel="noreferrer">RabbitMQ</a>：RabbitMQ 是实现了高级消息队列协议（AMQP）的开源消息代理软件（亦称面向消息的中间件）。</li></ul><h3 id="实践经验" tabindex="-1">实践经验 <a class="header-anchor" href="#实践经验" aria-label="Permalink to &quot;实践经验&quot;">​</a></h3><ul><li><a href="https://www.cnblogs.com/mingyueyy/p/16366360.html" target="_blank" rel="noreferrer">SpringCloud GateWay 万字详解</a></li><li><a href="https://blog.fintopia.tech/60e27b0e2078082a378ec5ed/" target="_blank" rel="noreferrer">Spring Cloud Gateway 原理介绍和应用</a></li><li><a href="https://www.cnblogs.com/starsray/p/16434558.html" target="_blank" rel="noreferrer">Kubernetes 基础入门（完整版)</a></li></ul><h2 id="devops" tabindex="-1">DevOps <a class="header-anchor" href="#devops" aria-label="Permalink to &quot;DevOps&quot;">​</a></h2><h3 id="开发工具" tabindex="-1">开发工具 <a class="header-anchor" href="#开发工具" aria-label="Permalink to &quot;开发工具&quot;">​</a></h3><ul><li><a href="https://doc.hutool.cn/pages/index/" target="_blank" rel="noreferrer">Hutool</a>：Hutool 是一个小而全的 Java 工具类库。</li><li><a href="https://mapstruct.org/" target="_blank" rel="noreferrer">Mapstruct</a>：MapStruct 是一个代码生成器，它基于一种约定而非配置方法，极大地简化了 JavaBean 类型之间映射的实现。</li><li><a href="https://www.mapstruct.plus" target="_blank" rel="noreferrer">Mapstruct plus</a>：可能是最简单最强大的 Java Bean 转换工具。</li><li><a href="https://unbug.github.io/codelf" target="_blank" rel="noreferrer">Codelf</a>: CodeLF 通过搜索在线开源平台 Github, Bitbucket, Google Code, Codeplex, Sourceforge, Fedora Projec 的项目源码，帮开发者从中找出已有的匹配关键字的变量名，CodeLF 是一款变量命名神器工具。</li><li><a href="https://zh-style-guide.readthedocs.io/" target="_blank" rel="noreferrer">zh-style-guide</a>: 中文技术文档写作风格指南，规范了一种中文写作风格，主要用于技术文档的编写。</li><li><a href="https://transform.tools/json-to-big-query" target="_blank" rel="noreferrer">转换工具</a>：提供各种开发中常用格式的转换，比如 JSON to JavaBean。</li></ul><h3 id="部署运维" tabindex="-1">部署运维 <a class="header-anchor" href="#部署运维" aria-label="Permalink to &quot;部署运维&quot;">​</a></h3><ul><li><a href="https://vuepress.mirror.docker-practice.com/" target="_blank" rel="noreferrer">Docker — 从入门到实践</a></li><li><a href="https://hub.docker.com/search?q=" target="_blank" rel="noreferrer">Docker Hub</a></li><li><a href="https://about.gitea.com/" target="_blank" rel="noreferrer">Gitea</a>：轻量级全功能 DevOps 开发平台，私有化代码仓库服务。</li></ul><h2 id="前端技术" tabindex="-1">前端技术 <a class="header-anchor" href="#前端技术" aria-label="Permalink to &quot;前端技术&quot;">​</a></h2><h3 id="javascript" tabindex="-1">JavaScript <a class="header-anchor" href="#javascript" aria-label="Permalink to &quot;JavaScript&quot;">​</a></h3><ul><li><a href="https://es6.ruanyifeng.com/" target="_blank" rel="noreferrer">ES6 入门教程</a>：《ECMAScript 6 入门教程》是一本开源的 JavaScript 语言教程，全面介绍 ECMAScript 6 新引入的语法特性。</li><li><a href="https://www.typescriptlang.org/zh/" target="_blank" rel="noreferrer">TypeScript</a>：TypeScript 是带有类型语法的 JavaScript。</li><li><a href="https://cn.vuejs.org/" target="_blank" rel="noreferrer">Vue</a>: 易学易用，性能出色，适用场景丰富的 Web 前端框架。</li><li><a href="https://router.vuejs.org/zh/" target="_blank" rel="noreferrer">Vue-Router</a>：为 Vue.js 提供富有表现力、可配置的、方便的路由。</li><li><a href="https://pinia.vuejs.org/zh/" target="_blank" rel="noreferrer">Pinia</a>：新一代的 Vue.js 状态管理库。</li></ul><h3 id="管理和构建工具" tabindex="-1">管理和构建工具 <a class="header-anchor" href="#管理和构建工具" aria-label="Permalink to &quot;管理和构建工具&quot;">​</a></h3><ul><li><a href="https://cn.vitejs.dev/" target="_blank" rel="noreferrer">Vite</a>：下一代的前端工具链。</li><li><a href="https://www.npmjs.cn/" target="_blank" rel="noreferrer">Npm</a>：npm 为你和你的团队打开了连接整个 JavaScript 天才世界的一扇大门。它是世界上最大的软件注册表。</li><li><a href="https://pnpm.io/zh/" target="_blank" rel="noreferrer">Pnpm</a>：快速的，节省磁盘空间的包管理工具。</li><li><a href="https://www.yarnpkg.cn/" target="_blank" rel="noreferrer">Yarn</a>：Yarn 是一个软件包管理器，还可以作为项目管理工具。</li></ul><h3 id="ui-框架" tabindex="-1">UI 框架 <a class="header-anchor" href="#ui-框架" aria-label="Permalink to &quot;UI 框架&quot;">​</a></h3><ul><li><a href="https://element-plus.org/zh-CN" target="_blank" rel="noreferrer">Element Plus</a></li><li><a href="https://antdv.com/components/overview-cn" target="_blank" rel="noreferrer">Ant Design Vue</a></li><li><a href="https://www.naiveui.com/zh-CN/light" target="_blank" rel="noreferrer">Naive UI</a></li></ul><h3 id="图片图标资源" tabindex="-1">图片图标资源 <a class="header-anchor" href="#图片图标资源" aria-label="Permalink to &quot;图片图标资源&quot;">​</a></h3><ul><li><a href="https://wallhaven.cc/" target="_blank" rel="noreferrer">Wallhaven</a>: 一个优质的高清图片资源网站，强烈推荐！</li><li><a href="https://www.iconfont.cn/" target="_blank" rel="noreferrer">IconFont</a>: 阿里巴巴矢量图标库。</li></ul><h3 id="静态网站" tabindex="-1">静态网站 <a class="header-anchor" href="#静态网站" aria-label="Permalink to &quot;静态网站&quot;">​</a></h3><ul><li><a href="https://docsify.js.org/#/zh-cn/" target="_blank" rel="noreferrer">Docisfy</a>：一个神奇的文档网站生成器，docsify 可以快速帮你生成文档网站。</li><li><a href="https://vuepress.vuejs.org/zh/" target="_blank" rel="noreferrer">Vuepress</a>：Vue 驱动的静态网站生成器。</li><li><a href="https://theme-hope.vuejs.press/zh/" target="_blank" rel="noreferrer">Vuepress-theme-hope</a>：一个具有强大功能的 vuepress 主题。</li><li><a href="https://www.docusaurus.io/zh-CN/" target="_blank" rel="noreferrer">Docusaurus</a>：Docusaurus 是一款静态站点生成器。我们释放了 React 的全部潜能，搭建了这一款有着快速客户端导航与交互性极佳的单页应用。它提供了开箱即用的文档功能，不过也可用于搭建各种网站（个人网站、产品、博客、营销主页，等等）。</li></ul><h3 id="admin-模板" tabindex="-1">Admin 模板 <a class="header-anchor" href="#admin-模板" aria-label="Permalink to &quot;Admin 模板&quot;">​</a></h3><ul><li><a href="https://doc.vvbin.cn/" target="_blank" rel="noreferrer">Vue-Vben-Admin</a>：Vue Vben Admin 是一个免费开源的中后台模版。使用了最新的 vue3,vite4,TypeScript 等主流技术开发，开箱即用的中后台前端解决方案，也可用于学习参考。</li><li><a href="https://element-plus-admin-doc.cn/" target="_blank" rel="noreferrer">Vue-element-plus-admin</a>：一套基于 vue3、element-plus、typesScript4、vite3 的后台集成方案。</li><li><a href="https://docs.soybean.pro/" target="_blank" rel="noreferrer">Soybean-admin</a>：基于 Vue3 + Vite3 + TS + NaiveUI + UnoCSS，清新优雅的中后台模版。</li><li><a href="https://github.com/HalseySpicy/Geeker-Admin" target="_blank" rel="noreferrer">Geeker-Admin</a>：Geeker Admin，基于 Vue3.3、TypeScript、Vite4、Pinia、Element-Plus 开源的一套后台管理框架。</li><li><a href="https://github.com/jekip/naive-ui-admin" target="_blank" rel="noreferrer">Naive-ui-admin</a>: Naive Ui Admin 是一个基于 vue3,vite2,TypeScript 的中后台解决方案，它使用了最新的前端技术栈。</li></ul><h2 id="快速开发脚手架" tabindex="-1">快速开发脚手架 <a class="header-anchor" href="#快速开发脚手架" aria-label="Permalink to &quot;快速开发脚手架&quot;">​</a></h2><ul><li><a href="https://gitee.com/y_project/RuoYi" target="_blank" rel="noreferrer">RuoYi</a>：RuoYi 一款基于基于 SpringBoot 的权限管理系统 易读易懂、界面简洁美观，直接运行即可用。</li><li><a href="https://github.com/zhangdaiscott/jeecg-boot" target="_blank" rel="noreferrer">JeecgBoot</a>：一款基于代码生成器的 J2EE 低代码快速开发平台，支持生成前后端分离架构的项目。</li><li><a href="https://gitee.com/erupt/erupt" target="_blank" rel="noreferrer">Erupt</a> : 低代码全栈类框架，它使用 Java 注解 动态生成页面以及增、删、改、查、权限控制等后台功能。</li><li><a href="https://github.com/YunaiV/ruoyi-vue-pro" target="_blank" rel="noreferrer">RuoYi-Vue-Pro</a>：RuoYi-Vue 全新 Pro 版本，优化重构所有功能。</li><li><a href="https://github.com/YunaiV/yudao-cloud" target="_blank" rel="noreferrer">yudao-cloud</a>：ruoyi-vue-pro 全新 Cloud 版本，优化重构所有功能。</li><li><a href="https://gitee.com/xiaonuobase/snowy" target="_blank" rel="noreferrer">Snowy</a>：国内首个国密前后端分离快速开发平台，定位不是深度封装的框架，也不是无代码平台，更不是某个领域的产品。</li></ul>',41),o=[i];function n(h,s,c,u,f,p){return r(),a("div",null,o)}const d=e(l,[["render",n]]);export{b as __pageData,d as default};
